text': "This has been the most dreadful encounter with customer service and a pizza establishment. I opted for a home delivery, but after waiting for an excruciating 1 hour and 30 minutes, the pizza failed to arrive. I decided to visit the branch in person and to my dismay, I found several others (who had also chosen delivery) complaining about undelivered pizzas. Even more frustrating, those who had physically come to the Dominos outlet had waited for approximately 2 hours without their orders being fulfilled.

The entire coordination among the pizza team at the outlet was in shambles, and shockingly, there wasn't a single branch manager present to manage the chaotic situation. Can you believe it? To add to the frustration, the cashier was still accepting new orders despite the ongoing chaos, and the staff seemed completely overwhelmed by the sheer volume of customers. Consequently, those who had placed pizza orders had to endure a staggering wait of at least 2.5 hours before receiving their orders.

When I inquired about the estimated time for my pizza to be ready from the oven, I was told it would take just 5 minutes. However, even after 20 minutes had passed, my order remained incomplete. To make matters worse, not even a gesture of compensation or a voucher was offered after I had waited for a full hour. This experience has left me utterly dismayed and profoundly disappointed. The lack of accountability and proper management is completely unacceptable. If I had the choice to order next time, I definitely wouldn't consider it.", 'time': 1691851664, 'translated': False}, {'author_name': 'Asman Mohd', 'author_url': 'https://www.google.com/maps/contrib/115446992108948157522/reviews', 'language': 'en', 'original_language': 'en', 'profile_photo_url': 'https://lh3.googleusercontent.com/a-/ALV-UjXKw4jezXBXdwiOKW5NrlBFY1f8EAOsBKTA672W23YjDA=s128-c0x00000000-cc-rp-mo-ba5', 'rating': 1, 'relative_time_description': '7 months ago', 'text': 'The most stupid outlets. On 30th march 2023 6pm the outlets manager refused to take order because the waiting time is 1hour or more to prepare and they have their handfull (not enough staff maybe). The most stupid excuses. Spoce he or she can suggest to come at 8pm or 8.30pm because now the having over whelming order.', 'time': 1680172782, 'translated': False}, {'author_name': 'Chu He Choong', 'author_url': 'https://www.google.com/maps/contrib/112538766086914500915/reviews', 'language': 'en', 'original_language': 'en', 'profile_photo_url': 'https://lh3.googleusercontent.com/a-/ALV-UjVB8cL5jKKeVU7Ssygp-FNBvbMGK74eeJKGVAmaAI7QHy6h=s128-c0x00000000-cc-rp-mo-ba3', 'rating': 4, 'relative_time_description': 'a year ago', 'text': 'Easy to spot, in Main Street. Parking is hard lucky the shop design is for mostly pickup. Only 3 table in the shop. Staff friendliness is so so. Didn’t even bother to introduce or greeting.', 'time': 1649311910, 'translated': False}, {'author_name': 'Shweta Vohra', 'author_url': 'https://www.google.com/maps/contri